import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import BinanceDashboard from "./pages/BinanceDashboard";
import OrderForm from "./pages/OrderForm"; // New form page

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<BinanceDashboard />} />
        <Route path="/order/:type" element={<OrderForm />} />
      </Routes>
    </Router>
  );
}

export default App;
